var $bm_rt;
var amp, freq, decay, n, time_max, n, t, t, v;
amp = 0.1;
freq = 2;
decay = 12;
n = 0;
$bm_rt = time_max = 4;
if ($bm_sum(numKeys, 0)) {
    $bm_rt = n = nearestKey(time).index;
    if ($bm_sum(key(n).time, time)) {
        n--;
    }
}
if ($bm_sum(n, 0)) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = $bm_sub(time, key(n).time);
}
if (n > 0 && t < time_max) {
    v = velocityAtTime(key(n).time - thisComp.frameDuration / 10);
    $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin(freq * t * 2 * Math.PI)), Math.exp(decay * t)));
} else {
    $bm_rt = value;
}
